// Types of Rendering files by using React

import React from "react";
import ReactDom from "react-dom";
// This type of rendering is new method applicable in only above versions like 16.2++ versions
ReactDom.render(
    <>
    <h1>Hi This is Abhishek Nayak</h1>
    <p>I am now coding this in the year of 2020</p>
    </>,
    document.getElementById("root"));

// Rendering by using div and one div will contain each and every tags

ReactDom.render(
    <diV>
        <h1>I am a heading</h1>
        <p>I am a paragraph</p>
    </diV>,document.getElementById("root")
);

// RENDERING BY USING LIST/ARRAY WITH COMMA SEPARTED TAGS
ReactDom.render(
    [
        <h1>I AM WRITTEN INSIDE H1 TAG</h1>,
        <p>I am writeen inside the paragraph tag</p>,
        <p>I am writeen inside the paragraph2  tag</p>
    ],document.getElementById("root")
);
